export default function App() {
    return ( <
        Router >
        <
        Container fluid >
        <
        Row >
        <
        Col className = "col-md-2 bg-white position-sticky shadow" >
        <
        Sidebar / >
        <
        /Col>{" "} <
        Col className = "col-md-10" >
        <
        Navbar > < /Navbar>{" "} <
        Switch >
        <
        Route path = "/:id"
        children = { < child / > }
        /> <
        /Switch>{" "} <
        /Col>{" "} <
        /Row>{" "} <
        /Container>{" "} <
        /Router>
    );
}

function child() {
    let { id } = useParams();
    return ( <
        h1 > { id } < /h1>
    )
}

function Dashboard() {
    return ( <
        div className = "main" >
